250g truskawek
Pół szklanki wody
2 łyżki mąki ziemniaczanej
2 łyżki żelatyny
2,5 łyżki słodziku
300 ml smietanki 30%
Łyżka soku z cytryny

Odstawiamy żelatyne namoczoną w wodzie na około 7 minut aż napęcznieje. Truskawki kroimy w małe kawałki i podgrzewamy z cukrem i sokiem z  cytryny aż zmiękną i puszczą sok. Mąkę ziemniaczana rozpuszczamy w wodzie i dadajemy do truskawek cały czas mieszając gotujemy aż do otrzymania konsystencji kisielu. Zdejmujemy z ognia i dodajemy żelatyne, mieszamy aż do rozpuszczenia. Całość studzimy przez około 2 godziny. Śmietankę ubijamy na sztywną pianę. Mus truskawkowy przekładamy warstwowo ze śmietanką.

